import React, { Fragment } from 'react';
import { Helmet, HelmetProvider } from "react-helmet-async";

function SignUpEmployer() {
    return (
        <Fragment>
            <HelmetProvider>
        <Helmet>
          <title> Employer - Sign Up & Log In | Zom - IN </title>
        </Helmet>
      </HelmetProvider>
        </Fragment>
    )
}

export default SignUpEmployer
